import React from "react";
import WeatherDetails from "./WeatherDetails";
import WeatherIcon from "./WeatherIcon";

export default function Forecast() {
  return (
    <div className="Forecast">
      <div className="row">
        <div className="col">
          Wed <WeatherIcon code="01d" /> 9 10
        </div>
      </div>
    </div>
  );
}
